import React from "react";
import { Route, Switch } from "react-router-dom";
import HomePage from "../pages/HomePage";
import HighlightMenu from "../Components/HighlightMenu";

const PageContent = () => {
  return (
    // Page Componentleri
    <div>
      <Switch>
        <Route path="/" exact>
          <HomePage />
        </Route>
      </Switch>
    </div>
  );
};

export default PageContent;
